struct RoomInfo
{
    ::std::string name;
    ::Ice::Short activeUsers;

    bool operator==(const RoomInfo& rhs_) const
    {
        if(this == &rhs_)
        {
            return true;
        }
        if(name != rhs_.name)
        {
            return false;
        }
        if(activeUsers != rhs_.activeUsers)
        {
            return false;
        }
        return true;
    }

    bool operator<(const RoomInfo& rhs_) const
    {
        if(this == &rhs_)
        {
            return false;
        }
        if(name < rhs_.name)
        {
            return true;
        }
        else if(rhs_.name < name)
        {
            return false;
        }
        if(activeUsers < rhs_.activeUsers)
        {
            return true;
        }
        else if(rhs_.activeUsers < activeUsers)
        {
            return false;
        }
        return false;
    }

    bool operator!=(const RoomInfo& rhs_) const
    {
        return !operator==(rhs_);
    }
    bool operator<=(const RoomInfo& rhs_) const
    {
        return operator<(rhs_) || operator==(rhs_);
    }
    bool operator>(const RoomInfo& rhs_) const
    {
        return !operator<(rhs_) && !operator==(rhs_);
    }
    bool operator>=(const RoomInfo& rhs_) const
    {
        return !operator<(rhs_);
    }
};

